import {combineReducers} from "redux"
import info from "app/web/reducers/info"
import geo from "app/web/reducers/geo"
import form from "app/web/reducers/form"
import report from "app/web/reducers/report"

const reducers = combineReducers({
  info,
  geo,
  form,
  report
})

export default reducers
